
public class Varbasic21 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int x = 0;
		int y = 200;
		
		System.out.println("x: " + x + "/ y: " + y );
		
		int temp = 0;
		temp = x;
		x = y;
		y = temp;
		

		System.out.println("x: " + x + "/ y: " + y );

	}
	
}
